import React from 'react';
import styled from 'styled-components/native';

const LogoContainer = styled.View`
  background-color: grey;
  height: 200px;
  width: 200px;
`;

const Logo = () => (
  <LogoContainer>
    
  </LogoContainer>
);
export default Logo;
